import React from 'react'
import {BrowserRouter as Router,Switch,Route,Link} from 'react-router-dom'
import Home from '../pages/Home';
const AppRoutes = () => {
    return (
        <Router>
       <Switch>
           <Route exact path='/' component={Home}/>
           <Route  component={Error}/>
        </Switch>
        </Router>
    )
}
export default AppRoutes;
